-- ----------------------------
--  View structure for `producto_completa`
-- ----------------------------
DROP VIEW IF EXISTS `producto_completa`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY INVOKER VIEW `producto_completa` AS select `producto`.`precio_venta` AS `precio_venta`,`producto`.`id_producto` AS `id_producto`,`producto`.`codigo_producto` AS `codigo_producto`,`producto`.`descripcion` AS `descripcion`,`producto`.`codigo_fabricante` AS `codigo_fabricante`,`producto`.`codigo_barra_fabricante` AS `codigo_barra_fabricante`,`producto`.`precio_costo` AS `precio_costo`,`producto`.`precio_arriendo_dia` AS `precio_arriendo_dia`,`producto`.`precio_garantia` AS `precio_garantia`,`producto`.`precio_mes` AS `precio_mes`,`producto`.`oferta_especial_web` AS `oferta_especial_web`,`producto`.`activo_web` AS `activo_web`,`producto`.`id_sub_categoria` AS `id_sub_categoria`,`producto`.`id_categoria` AS `id_categoria`,`producto`.`descripcion_detallada` AS `descripcion_detallada`,`producto`.`fecha_creacion` AS `fecha_creacion`,`producto`.`destacado` AS `destacado`,`categoria`.`codigo_categoria` AS `codigo_categoria`,`categoria`.`descripcion_categoria` AS `descripcion_categoria`,`sub_categoria`.`codigo_sub_categoria` AS `codigo_sub_categoria`,`sub_categoria`.`nombre_sub_categoria` AS `nombre_sub_categoria` from ((`producto` join `categoria` on((`producto`.`id_categoria` = `categoria`.`id_categoria`))) join `sub_categoria` on((`producto`.`id_sub_categoria` = `sub_categoria`.`id_sub_categoria`)));

-- ----------------------------
--  View structure for `producto_imagen_principal`
-- ----------------------------
DROP VIEW IF EXISTS `producto_imagen_principal`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY INVOKER VIEW `producto_imagen_principal` AS select `producto`.`id_producto` AS `id_producto`,`producto`.`codigo_producto` AS `codigo_producto`,`producto`.`descripcion` AS `descripcion`,`producto`.`precio_venta` AS `precio_venta`,`producto`.`precio_arriendo_dia` AS `precio_arriendo_dia`,`producto`.`precio_garantia` AS `precio_garantia`,`producto`.`precio_mes` AS `precio_mes`,`producto`.`oferta_especial_web` AS `oferta_especial_web`,`producto`.`id_sub_categoria` AS `id_sub_categoria`,`producto`.`id_categoria` AS `id_categoria`,`producto`.`descripcion_detallada` AS `descripcion_detallada`,`imagen_producto`.`nombre_archivo` AS `nombre_archivo`,`imagen_producto`.`id_imagen` AS `id_imagen`,`producto`.`destacado` AS `destacado`,`producto`.`activo_web` AS `activo_web` from (`producto` join `imagen_producto` on((`producto`.`id_producto` = `imagen_producto`.`id_producto`))) where ((`imagen_producto`.`activo` = 1) and (`imagen_producto`.`principal` = 1) and (`producto`.`activo_web` = 1));

